import React from "react";
import { BaseElemetPropsType } from "./BaseElemetPropsType";

type labelType = BaseElemetPropsType & { htmlFor?: string; form?: string };

function Lable(props: labelType) {
	return <label {...props}>{props.title}</label>;
}

export default Lable;
